# @param {Integer[]} nums
# @return {Integer}
def remove_duplicates(nums)
  dup_count = 0
  (0).upto(nums.length - 1) do |i|
    _current = nums[i]
    nexti = i + 1
    while nums[nexti] && nums[nexti] == _current
      dup_count += 1
      nums[nexti] = nil
      nexti += 1
    end
  end
  # nums.compact!
  nums.sort_by! { |a| a.nil? ? Float::INFINITY : a }
  return nums.length - dup_count
end

